            <span>Totale costo: {/*costoTot*/} </span>
        </div>
        <div className={"col-sm-3 p-1"}>
            <span>Media globale consumi: {/*kmTot/litriTot*/} km/L</span>
        </div>
    </div>
    </div>
);
}

export default Riepilogo;
